function Users({ users }) {
    let image = "https://grupo8-bits.herokuapp.com/img/users/"+users.image;
    return(
      <tbody id="myTable">
        {users.map(user => (
          <tr key={user.id}>
          <td>{user.id}</td>
          <td><img src="https://grupo8-bits.herokuapp.com/img/users/group-1628285793922.jpeg" height="50px" width="50px" alt=""/></td>
          <td>{user.firstName}</td>
          <td>{user.lastName}</td>
          <td>{user.email}</td>
          <td>{user.city}</td>
        </tr>
        ))}
          </tbody>
    )
  }

  export default Users;
